local a=plugin:CreateToolbar("Parabellum Tools")local b=a:CreateButton("Package Map","Package map into a Project Parabellum Compatible Map","rbxassetid://4458901886")local function c()print("Packaging map. Please wait...")local d=Instance.new("Model")for e,f in pairs(workspace:GetChildren())do if f.Name~="Terrain"and f.Name~="Camera"then f.Parent=d end end;print("Packaged workspace")local g=Instance.new("NumberValue")g.Value=game:GetService("Lighting").ClockTime;g.Name="tod"g.Parent=d;print("Packaged Clocktime")local h=Instance.new("NumberValue")h.Value=game:GetService("Lighting").GeographicLatitude;h.Name="GL"h.Parent=d;print("Packaged Geographic Latitude")if game:GetService("Lighting"):FindFirstChild("Atmosphere")then game:GetService("Lighting"):FindFirstChild("Atmosphere").Parent=d;print("Packaged Atmosphere")end;if game:GetService("Lighting"):FindFirstChild("Sky")then game:GetService("Lighting"):FindFirstChild("Sky").Parent=d;print("Packaged Sky")end;d.Name="Packaged Map"d.Parent=workspace;print("Successfully packaged map!")end;b.Click:Connect(c)